import {
  FormControl,
  Button,
  FormGroup,
  Navbar,
  NavItem,
  Container,
  Image,
  ButtonGroup,
  Nav,
  Form,
} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.css';
//import classes from "./NavigBar.module.css";
//import './NavigBar.css'
function NavigBar() {
  return (
    <div>
        <Navbar>

    <Navbar.Brand href="#home">Navbar with text</Navbar.Brand>

    <Nav className="me-auto">
      <Navbar.Text>
        Signed in as: <a href="#login">Mark Otto</a>
      </Navbar.Text>
    </Nav>

</Navbar>

    </div>
  );
}
export default NavigBar;
